// Create/Update memo letter buttons
function updateLetterButtons(newLabels) {
  const buttons = document.querySelectorAll("#letterButtons button");

  const rotatedLabels = [...newLabels.slice(1), l[0]];

  // Update only the first 12 buttons (the character buttons)
  buttons.forEach((btn, index) => {
    if (index < 12 && rotatedLabels[index]) {
      const letter = rotatedLabels[index];
      btn.textContent = letter;

      // Remove old event listeners by cloning and replacing
      const newBtn = btn.cloneNode(true);
      newBtn.textContent = letter;
      newBtn.addEventListener('click', () => {
        if (memo.length < 20) {
          memo += letter;
        }
        if ([2, 5, 8, 11, 14, 17].includes(memo.length)) {
          memo += " ";
        }
        document.querySelector("#memo").innerText ="Memo: " + memo;
      });

      btn.replaceWith(newBtn);
    }
  });
}

